🇺🇸 🇺🇦 The US Department of Defense announced the details of the next package of military assistance to Ukraine.

🔻What is supplied by the $1 billion allocated by the State Department:

▪️One Patriot battery and ammunition;
▪️ammunition for HIMARS
▪️500 artillery shells 155mm with precise guidance;
▪️10 120mm mortar systems and 10,000 120mm mortar shells;
▪️10 82mm mortar systems;
▪️10 60mm mortar systems;
▪️37 Cougar MRAP;
▪️120 HMMWV vehicles;
▪️6 armored general purpose trucks;
▪️an unnamed amount of HARM;
▪️an unnamed amount of JADM;
▪️more than 2,700 grenade launchers and small arms;
▪️claymore anti-personnel ammunition;
▪️night vision devices and optics;
▪️tactical secure communication systems;
▪️ body armor.

🔻What is supplied in the amount of $850 million allocated by the Pentagon:

▪️45,000 152mm artillery shells;
▪️20,000 122mm artillery shells;
▪️50,000 122-mm rockets for BM-21 Grad systems;
▪️100,000 125 mm tank ammunition;
▪️SATCOM terminals and services;
▪️Funding training, maintenance.

Algo me chamou atenção nas falas do José Maria Trindade e do Paulo Figueiredo hoje:

1. Em nenhum momento eles falaram que o Lula iria assumir dia 1°;
2. Presidente está sereno e vai o que deve fazer;
3. O presidente sabe de tudo que está acontecendo no país;
4. Paulo Figueiredo fala: eu não aceitaria ser difamado da forma que o presidente está sendo e 'acho que ele também não irá permitir'.
